import{_ as e,o as t,c as o,a as s}from"./App.e276bd0f.js";const a="/img/info_first_cell_capture.png",n="/img/info_cell_lvlup.png",r="/img/info_free_cell_capture.png",l="/img/info_energy_transfer.png",c="/img/info_enemy_capture.png",i="/img/info_game_rooms.png",p="/img/info_this_game.png",h="/img/info_30days_top.png";const u={},d={class:"howto-wrapper flex flex-col"},m=s('<h1>Game play</h1><p> The goal of the game is to own as many cells as possible by the end of the round. </p><p> You can always minimize the information panel for a more comfortable game. </p><p> You can also move the map by pressing the &quot;A&quot;-\u2B05\uFE0F, &quot;D&quot;-\u27A1\uFE0F, &quot;W&quot;-\u2B06\uFE0F, &quot;S&quot;-\u2B07\uFE0F </p><p class="p40"> The cell has the following stats: current amount of energy, base capacity, rate of energy production. </p><p> Game Parameters:<br> Empty Cell Marking Price: 4000 <span class="energy">\u26A1\uFE0F</span><br> Levelup: 3000 <span class="energy">\u26A1\uFE0F</span><br></p><p> Maximum Cell Capacity:<br> Level 1 - 5000 <span class="energy">\u26A1\uFE0F</span><br> Level 2 - 7000 <span class="energy">\u26A1\uFE0F</span><br> Level 3 - 10000 <span class="energy">\u26A1\uFE0F</span><br></p><p> Energy generation in the cell:<br> level 1 - 20 <span class="energy">\u26A1\uFE0F</span>/sec<br> Level 2 - 35 <span class="energy">\u26A1\uFE0F</span>/sec<br> Level 3 - 50 <span class="energy">\u26A1\uFE0F</span>/sec<br></p><p> Decreasing energy in the cell when it exceeds its capacity: 20 <span class="energy">\u26A1\uFE0F</span>/sec </p><img src="'+a+'"><p> Capture the first cell. To capture the first cell, double left-click on any free cell on the map. </p><p> After the last player joins and captures the first cell the round begins. The round lasts for 20 minutes. </p><img src="'+n+'"><p> Upgrade the level of your cell. To do this, mark the desired cell by clicking it once with the left mouse button, and then double-click the same cell with the left mouse button. </p><p> You will lose 3k energy - this is the cost of the lvlup. Now the energy production rate of this cell has increased. </p><img src="'+r+'"><p>Wait until you accumulate 4k energy and capture the next cell.</p><p> To do this, click on the cell near which you want to capture the cell and click on the cell you want to capture. You will lose 4k - this is the cost of the capture. </p><p>Now you control two cells.</p><img src="'+l+'"><p> Wait until the energy of the cells fills up. Then transfer energy from the first cell to the second cell. To do this, select cell 1 and dbl click on cell 2. </p><p> Now the energy of cell two has exceeded the base capacity and every second it will lose energy until it returns to the base capacity level. Hurry up to use your energy advantage in your tactics. </p><img src="'+c+'"><p> If you are adjacent to an enemy cell, you can attack and capture it if your energy exceeds the enemy&#39;s. To do this, select your cell and then the enemy cell. Energy is subtracted and if your energy is greater, the cell will be captured. </p><h2>Interface</h2><div class="interface-wrap"><div><img src="'+i+'"><h3>Game rooms</h3><p> The panel displays all the current locations created by the players. To the right of each location is the number of players who have joined the game and the maximum number of players in the room. </p><p> 1/3 means that the game joined 1 player out of 3. If not all seats are taken yet, you can join the game by pressing &quot;Join&quot;. </p><p> The round starts as soon as the required number of players is reached. If the location is already filled with players, you can press &quot;Info&quot; and become an observer. </p></div><div><img src="'+p+'"><h3>This game</h3><p> After you have selected a room with the &quot;Join&quot; or &quot;Info&quot; buttons, information about it will be displayed in the &quot;This game&quot; tab. </p><p> The list shows the address of the player and the number of cells he has captured. </p><p> The color of the address in the list shows the color of the player&#39;s cells on the map. </p></div><div><img src="'+h+'"><h3>30 days TOP</h3><p>The best players are placed in the &quot;30 days TOP&quot;.</p><p> The list shows the address of the player and the number of captured cells in the games in which he participated. </p></div></div>',26),y=[m];function g(f,_){return t(),o("div",d,y)}const w=e(u,[["render",g]]);export{w as default};
